import React, {Component} from 'react';

class Create extends Component {

  render() {
    console.log(this.props.create);
    return (
      <div>
        Vendor 
        <input type="text" className="form-control" placeholder="Input Vendor name..." id="vendor" name="vendor"></input>
        Date-Received 
        <input type="text" className="form-control" placeholder="Input Date..." id="date" name="date"></input>
        PO# 
        <input type="text" className="form-control" placeholder="Input PO#..." id="po" name="po"></input>
        Material 
        <input type="text" className="form-control" placeholder="Input Material..." id="material" name="material"></input>
        Quantity 
        <input type="text" className="form-control" placeholder="Input Quantity..." id="quantity" name="quantity"></input>
        <button>Save</button>
      </div>
    );
  }
}
export default Create;
